INSERT INTO recipes VALUES (UNHEX(REPLACE('df30c39c-60cc-4721-8319-f52710120a2b', '-','')), 'Vi har testet den virale trenden sushivaffel. Du finner den også under Sushi Waffles, og Crispy Rice Waffles på TikTok. Dette tipset fungerer aller best om du bruker sushiris, så har du rester fra sushi i går, kan dette være den perfekte lunsj neste dag. Vi topper med laks, avokado, syltet rødløk og chilimajo.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/tcqi3anqwhvbgpag7tmx/sushivaffel', 'Dersom du ikke har rester av sushiris, lager den denne først. [Se oppskrift på sushiris her](/tema/fisk/sushi/sushiris/)
INSERT INTO recipes VALUES (UNHEX(REPLACE('fcf5def2-1b3a-4aee-993f-591076785a3f', '-','')), 'Oppskrift på enkel fiskeburger med fiskekake, syrlig eple og tzatziki. Server til lunsj eller middag med grove burgerbrød. Litt sunnere middag på under 20 minutter, for hele familien.', 60, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/e0u40qtmhoxfnbzqi93c/fiskeburger-med-tzatziki-og-eple', 'Stek fiskeburgerne i rapsolje på middels varme i to minutter på hver side.
INSERT INTO recipes VALUES (UNHEX(REPLACE('adafb387-93f5-48eb-aeac-64a8f5f756a3', '-','')), 'Oppskrift på enkel og rask fajitas med kylling, paprika, rødløk og guacamole. En spennende Tex-Mex med tacokrydder rett servert med kjempegodt tilbehør. Topp med frisk koriander! Du kan også bytte ut kyllingen med strimlede biter av biff.', 40, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/a5rfcedwqb8y3d0sgzm6/kylling-fajitas', 'Stek kyllingstrimlene i olje til de er gylne. Tilsett paprika og rødløk. Stek i ytterligere 3 minutter.
INSERT INTO recipes VALUES (UNHEX(REPLACE('ccfa1ed3-f20b-4d80-8ffa-ac4ccf4f616c', '-','')), 'Vår beste oppskrift på pannekakerøre til klassiske pannekaker. Pannekakene kan serveres med syltetøy til frokost, med ost og skinke til middag eller med is og sjokolade til dessert - her er det bare fantasien som setter grenser! Oppskriften gir ca. 8-10 pannekaker.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/ovcodoppihwu2kqayrmz/pannekaker', '**Pannekakerøre:** Begynn med å blande salt og mel, og ca. halvparten av melken. Visp sammen til røren er klumpfri.
INSERT INTO recipes VALUES (UNHEX(REPLACE('c8ff84b3-8bbc-4b61-b064-5e09429b878b', '-','')), 'Oppskrift på ovnsbakt kylling med blomkålris, appelsin, sukkererter og søte, små tomater. Se video for hvordan lage hjemmelaget blomkålris.', 40, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/atsdvp0kp4mhlthm3apr/kylling-med-blomkalris-og-appelsin', 'Brun kyllingen raskt i en varm stekepanne, til den har fått en stekeskorpe på alle kanter.
INSERT INTO recipes VALUES (UNHEX(REPLACE('ed87d9c7-25ae-4bad-8142-e4292312ec41', '-','')), 'Oppskrift på Jennifer Aniston salad, kjent fra sosiale medier. En skikkelig digg quinoasalat med urter, nøtter, kikerter og fetaost. Denne salaten er veldig populær da ryktene sier at Jennifer Aniston spiste denne hver dag under innspillingen av Friends.', 40, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/ossqly7akmzy3xxshibw/jennifer-aniston-salat', 'Kok quinoaen eller bulguren etter anvisningen på pakken i vann eller grønnsakskraft. Avkjøl og rør den luftig med en gaffel og ha det i en bolle.
INSERT INTO recipes VALUES (UNHEX(REPLACE('c362a304-f3a9-4c38-a1c9-5e330929da62', '-','')), 'Oppskrift på saftig lakseburger med kuttet mango og guacamole. Burgeren trenger kun få minutter i stekepannen, så denne familievennlige middagen er klar på kort tid. Guacamole kan du kjøpe ferdig, eller lage selv. [Se egen oppskrift her.](/oppskrifter/Sauser-og-dressinger/Dipper/Hjemmelaget-guacamole/)', 60, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/iwqbzwysllnxglsdcoyx/lakseburger-med-mango', 'Krydre lakseburgerne med salt og pepper. Stek dem så i litt rapsolje til de såvidt er gjennomstekt. Dette tar ca 1-2 minutter på hver side.
INSERT INTO recipes VALUES (UNHEX(REPLACE('a672db58-7c08-4e1f-989d-8b0aff3ed0e3', '-','')), 'Oppskrift på Philly cheese steak med saftige biffstrimler. I denne oppskriften bruker vi Angus biffsnadder, som du får kjøpt ferdig på Meny. Topp baguetten med paprika, revet ost, og sennepsmajones, for et raskt og utrolig godt måltid. Server som digg lunsj eller middag.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/lorgmsncreofwykdcquw/philly-cheese-steak-med-biff', 'Skjær paprika i strimler. Stek biff og paprika i olje i en stekepanne i ca. 5 minutter, til kjøttet er gyllent og gjennomvarmt.
INSERT INTO recipes VALUES (UNHEX(REPLACE('9e1b9b91-f016-4907-9739-5d91ff634c5c', '-','')), 'En kjempegod og syrlig oppskrift på pasta al limone. Pasta med sitron er en pastarett som går fort å lage og fint kan serveres i hverdagen. Hvis du har ekstra god tid kan du også lage pastaen selv ved å følge [denne oppskriften på hjemmelaget pasta](oppskrifter/Pasta/Hjemmelaget-pasta/)', 40, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/vmw8vubj629fj1o9vbiu/pasta-al-limone', 'Fres finhakket hvitløk i smør i en stekepanne i 2 minutter. Tilsett kremfløte og la koke i 5 minutter til fløten tykner litt.
INSERT INTO recipes VALUES (UNHEX(REPLACE('50c4fb14-2c59-4db3-8f0e-febdcd266df1', '-','')), 'Oppskrift på kjempegod kjøttfri gryte med smaker fra India. Her får du både røde linser, grønnsakskraft, hvitløk, chili, ingefær og annet som gir denne retten masse smak. Server gjerne med naan brød og kokt ris.', 40, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/yzbs45mfmlcqbiyuqr9g/linsegryte-med-chili-og-ingefaer', 'Varm rapsoljen i en kjele. Ha i løk, hvitløk, ingefær og chili. La frese i 2 minutter.
INSERT INTO recipes VALUES (UNHEX(REPLACE('7c733a2a-fcc3-4ef8-8bde-12bacd060b75', '-','')), 'Oppskrift på mettende vegetarsalat med grillet halloumi, ruccola, tomater og bønner. En frisk og fargerik salat, perfekt på våren og sommeren. Salaten er enkel å lage, og de milde smakene passer til hele familien. Halloumi er en fyldig ost som egner seg godt på grillen, og som smaker best når den er varm.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/v73smoi5qlssoobjlysy/halloumisalat', 'Bland sammen ruccola, hakkede tomater, finhakket rødløk, brokkoli, bønner, olivenolje, sitronsaft og -skall og pinjekjerner i en bolle.
INSERT INTO recipes VALUES (UNHEX(REPLACE('bb294ced-18d0-4e80-8e31-a1745a9a7ab3', '-','')), 'Dette er en oppskrift på rask og smakfull kyllinggryte med sopp, bacon, løk, kremost og urter. Et godt middagstips med kylling for hele familien, til hverdag eller helg!', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/tinsvtc5zngnfti0bql3/kremet-kyllinggryte-med-bacon', 'Hakk løk og hvitløk. Del opp kyllingfiletene i terninger. Del champignonen i biter og skjær opp bacon i små terninger.
INSERT INTO recipes VALUES (UNHEX(REPLACE('76e549a0-cb84-4066-825b-2df510c78199', '-','')), 'Oppskrift på enkel pasta med saftig svinefilet og grønn pesto.  Dryss gjerne litt revet parmesan over rett før servering.', 40, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/vyuanbotuul99ikiwgkd/pasta-med-svinefilet-og-pesto', 'Kok pastaen etter anvisningen på pakken.
INSERT INTO recipes VALUES (UNHEX(REPLACE('f197305f-b798-41d2-b069-6a8cd459eb08', '-','')), 'Oppskrift på red curry med kongereker, også kalt scampi eller villreker. Sausen er krydret og god, med brokkoli, asparges og kokosmelk.', 60, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/pvobc5hso4fxbq1cajri/red-curry-med-kongereker', 'Start med å skrelle kongerekene. Ta av hodet og rens resten som en «vanlig» reke. Behold halen på. Skjær et snitt langs toppen av rekene, og ta ut den mørke strengen.
INSERT INTO recipes VALUES (UNHEX(REPLACE('114bdc86-f68f-4a5e-a835-c8a67cbec4e6', '-','')), 'Visste du at focaccia egner seg godt som hamburgerbrød? Prøv en enkel oppskrift på hamburger i focaccia med grillet løk og aioli.', 60, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/xsqyngvrt3n1ucwyl5bx/hamburger-i-focaccia-med-grillet-lok-og-aioli', 'Skjær løken, med skall, i tykke skiver. Pensle med olje og grill eller stek løkskivene, ca. 5 min. på hver side. Fjern skallet, ha over eddik og olje og krydre med salt og pepper. Hakk koriander og strø over.
INSERT INTO recipes VALUES (UNHEX(REPLACE('64e51af7-cc17-4a69-ab76-49fa5496b2ed', '-','')), 'Ovnsbakt søtpotet er enkelt og veldig godt! Denne kan du fylle med nesten hva du vil, og servere som tilbehør eller hovedrett. Her lager vi enkel søtpotet med hjemmelaget urtesmør. Server gjerne til grillmat.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/qwyubugjwl0upme0iv6d/bakt-sotpotet-med-ingefaer-og-gressloksmor', 'Vask søtpotetene og stikk dem et par ganger med en gaffel. Legg aluminiumsfolie i en ildfast form, dryss over havsalt og legg søtpotetene over saltet. Bak på grill eller i ovn på 200 grader i cirka 45 minutter, til søtpotetene er helt møre. Dersom du bruker grillen trenger du ikke den ildfaste formen, kun aluminiumsfolie.
INSERT INTO recipes VALUES (UNHEX(REPLACE('7615677f-8ff7-4560-bb8d-b797324513ed', '-','')), 'Enkel oppskrift på kyllingfilet, stekt blomkålris, spinat og tzatziki. Friske bær eller frukt som appelsin er også godt tilbehør. Rask middag som hele familien vil like. Se i video  hvordan du lager blomkålris.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/jmkbcr95bymztulfgaiu/stekt-kylling-med-blomkalris', '**Steke kylling** Krydre kyllingfiletene med salt og pepper. Brun kyllingfiletene i olje i en stekepanne til de er gylne på begge sider. Ha dem så i en ildfast form, midt i ovnen på 180 grader, og stek til kyllingfiletene er gjennomstekt. Dette tar ca. 15-20 minutter.
INSERT INTO recipes VALUES (UNHEX(REPLACE('3bcc728b-e2af-4e93-95f1-ff09a0b0c61a', '-','')), 'Denne oppskriften på wraps med reinsdyr og nøtter ser ikke bare god ut, men smaker himmelsk! En sunn favorittrett som lett kan tas med i hånda, eller pakkes i matboksen.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/pkgtxixemqvrf46vtr71/fullkornswrap-med-reinskav-og-cashewnotter', 'Sunn favorittrett til matboksen. Bland gjerne litt frikse eller frosne tyttebær med kjøttet eller server med en søt-syrlig chutney.
INSERT INTO recipes VALUES (UNHEX(REPLACE('cbfbc355-9aed-4030-b86d-9e90834455be', '-','')), 'Asiatisk wok med strimlet biffkjøtt av storfe og grønnsaker som sprø paprika, søt mango, toppet med granateple og sesamfrø. Vi anbefaler woksaus fra MENY, velg mellom hoisin eller szechuan. Litt sunnere og enkelt middagtips for hele familien.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/wzbat0qumkf8ld4jacal/biffwok-med-nudler-og-mango', 'Kok nudlene etter anvisning på pakken. Hell av vannet.
INSERT INTO recipes VALUES (UNHEX(REPLACE('aa15a75d-2234-46b7-8640-463727d28197', '-','')), 'Oppskrift på pølser med rotgrønnsaker. Superrask og enkel pølserett som alle liker! Perfekt som middag i høst.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/ji6yxeumuhi999fu7u7r/rokte-kjottpolser-med-smordampede-rotgronnsaker', 'Superrask og enkel pølserett som alle liker! Varier med brokkoli og blomkål eller grønnsaker etter smak.
INSERT INTO recipes VALUES (UNHEX(REPLACE('063de78a-92ed-4549-90d7-96c33c6a916b', '-','')), 'Supersunn grønnkål passer utmerket sammen med aromatisk sitrus og saftig kylling. Dette er en pastarett med masse god smak og fylde som hele familien vil elske.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/h4pt3pam99rch6qcmcaz/fullkornspasta-med-kremet-gronnkal', 'Kok fullkornspasta som anvist på pakken.
INSERT INTO recipes VALUES (UNHEX(REPLACE('3145dedb-a3c4-4e93-8ac7-cf9758bc6006', '-','')), 'Stifado er en gresk kjøttgryte full av nydelige middelhavssmaker. Om du har vært i Hellas er det store muligheter for at du har fått servert denne tradisjonelle retten. Har du lyst til å lage hjemmelaget stifado er dette en enkel gryterett som nesten lager seg selv. Du kan bruke mange typer kjøtt som f.eks. høyrygg eller oksebog.', 40, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/ptqrrt94crsh0saqu78c/stifado', 'Skjær kjøttet i terninger og stek i flere omganger i olivenolje i en varm stekepanne til det har fått en fin bruning på alle sider.
INSERT INTO recipes VALUES (UNHEX(REPLACE('32274acc-bf5b-4f26-b64a-7c25c0c47b1c', '-','')), 'Gratinert kyllingform er en enkel og god middag. I gratengen kan du gjerne ha rester. Topp kylling og grønnsaker med fløte og ost før gratinering. En ovnsrett som nesten lager seg selv!', 40, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/dqqfkbwdc2spozvndlf5/kyllinggrateng-med-gronnsaker', 'Varier med grønnsaker og ost etter egen smak og hva du har av rester i kjøleskapet.
INSERT INTO recipes VALUES (UNHEX(REPLACE('20d98b95-0733-4688-928c-be5115c5a124', '-','')), 'Prøv vår oppskrift på saftig vegetar burger med chunky hummus. Vi serverer burgeren med grove burgerbrød, ruccola og tomater, men du kan også variere toppingen med det du liker best. Tilbered i panne eller på grill, og du har en rask og veldig god middag!', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/rccyu88xgdygup7ljffd/vegetarburger-med-hummus', 'Stek vegetarburgerne i rapsolje i ca. 3 minutter på hver side, til de er gylne og gjennomvarme.
INSERT INTO recipes VALUES (UNHEX(REPLACE('fe451a7b-8f10-41c7-8c67-1c4645b2b217', '-','')), 'Enkel og god pølsegrateng med grønnsaker, makaroni og ost på toppen. En barnevennlig hverdagsrett som metter mange.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/cwd6wtsuig1937w0ml0f/polsegrateng-med-gronnsaker', 'Sett ovnen på 200 grader og kok makaronien etter anvisning på pakken.
INSERT INTO recipes VALUES (UNHEX(REPLACE('66b92cad-d5b1-434f-aea5-4142f6553827', '-','')), 'Lun kyllingsalat med saftig kylling og det beste av høstens grønnsaker. Lag en smakfull lunsj eller lett middag med fantastiske råvarer som søtpotet, gulrot og persillerot. Bruk gjerne vår kvalitetskylling Lerstang fra Jacobs Utvalgte.', 60, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/spcvtzh1n1ktocfhcjeu/hostsalat-med-kylling-og-ovnsbakte-gronnsaker', 'Sett ovnen på 210 °C. Del rødbeter, gulrot, søtpotet, sellerirot
INSERT INTO recipes VALUES (UNHEX(REPLACE('343125c7-dcec-4cf7-81e8-ba52ed42a7e2', '-','')), 'Kylling i kokosmelk, eller Khai Krati som det også heter, er en deilig, krydret Thailandsk kyllingrett. En deilig oppskrift på kyllinggryte med kokosmelk som er perfekt til hverdagsmiddag eller til helgen.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/zem2stf2ohkayjqhfpq0/kylling-i-kokossaus', 'Finn frem ingrediensene. Du kan bruke kyllingfilet eller kyllingbryst.
INSERT INTO recipes VALUES (UNHEX(REPLACE('2412e61f-d744-44db-92dd-b241efcd36e1', '-','')), 'Dette er favorittmat for hele familien. Quesadilla er en meksikansk matrett som lages av tortilla fylt med ost og ofte noe mer fyll, sammen med salsa. Her har vi brukt en grovere tortilla og kylling slik at dette blir en litt sunnere vri på fredagstacoen.', 60, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/cktdfivpqddkmkbyc6h7/grove-quesadillas-med-kylling-og-gronnsaker', 'Rens kyllingen slik at du kun sitter igjen med rent kyllingkjøtt i strimler.
INSERT INTO recipes VALUES (UNHEX(REPLACE('44b1d8af-8ce1-4d2f-924a-a6e62ab53751', '-','')), 'Oppskrift på tomatsuppe laget fra bunnen. Med hermetiske tomater, grønnsakskraft og noen gode grønnsaker får denne suppen mye god smak. Server den med egg og makaroni, chorizo, parmesan og urter eller som den er med pannekaker som rett nr 2. Se film for steg-for-steg.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/h3iu0dtahtgpbwwitew7/hjemmelaget-tomatsuppe', 'Fres løk, gulrot, stangselleri, hvitløk og chili i olivenolje i en kjele i 3 minutter.
INSERT INTO recipes VALUES (UNHEX(REPLACE('9d9c1331-9229-4df5-a41d-78025f6199dc', '-','')), 'Enkelt, sunt, mettende og godt; en grateng er perfekt hverdagsmat. Dette er en god oppskrift på pastagrateng som blir middagsfavoritt for store og små. Pastagrateng med kjøttdeig eller karbonadedeig passer ypperlig når det er mange rundt middagsbordet.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/pw28clevj2bxzotfrgfa/pastagrateng-med-kjottdeig', 'Stek kjøttdeigen/karbonadedeigen i olje til den er gyllen og gjennomstekt. Kutt sukkererter i biter, sjalottløk og vårløk i ringer.
INSERT INTO recipes VALUES (UNHEX(REPLACE('b045e5c9-6ba9-438e-867c-d0e682a311de', '-','')), 'Oppskrift på tykke, luftige, amerikanske pannekaker er populært til helgefrokosten. Amerikanske pannekaker serveres tradisjonelt med sirup, men smaker også veldig godt med noe salt, som bacon. Én porsjon gir 12 små og tykke pannekaker.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/soes8ggethz8ohpraikj/amerikanske-pannekaker-med-bacon', 'Fordel eggehviter og eggeplommer i to boller. Bland melk sammen med eggeplommene.
INSERT INTO recipes VALUES (UNHEX(REPLACE('f9173733-204b-4b74-a529-03159e31467a', '-','')), 'Oppskrift på rask pai som passer for hele familien. Tacopai med kjøttdeig og grønnsaker er et godt alternativ til fredagstacoen, eller om du har rester fra gårsdagens taco. Her topper vi den med speilegg.', 40, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/pndesnmio5hwzmiisl97/tacopai-med-kjottdeig', 'Kle en paiform med paibunnen og forstek den i ovnen på 180 grader til den begynner å få farge. Dette tar ca 10 minutter.
INSERT INTO recipes VALUES (UNHEX(REPLACE('b9fe879d-b0a7-40a8-be5e-02beabde90e3', '-','')), 'Smakfull vegetarisk gryterett med vegetarboller, kremet karrisaus, paprika og eple. Denne oppskriften er rask og enkel å lage og passer ikke bare for vegetarianere, men også for deg som vil spise litt grønnere eller bare lage noe som smaker utrolig godt!', 40, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/uorj7xie4mqhak27imww/vegetarboller-i-karrisaus', 'Stek bollene på middels varme og legg over på et fat. Stek så løk, paprika og hvitløk til løken er blank.
INSERT INTO recipes VALUES (UNHEX(REPLACE('9cb5c386-5d72-4a49-8cc4-3c4bd5024dad', '-','')), 'Oppskrift på Kun Pao med kyling, en kinesisk klassiker fra provinsen Sichuan. Denne retten får en herlig balanse i smakene fra både søt honning, salt soya og spicy chili.', 60, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/ksqfqqejkrf1wygb1eml/kung-pao-chicken', 'Stek rosépepper i en tørr panne til aromaene kommer frem, ca. 2 minutter. Knus dem deretter i en morter. Bland de knuste pepperkornene med 1,5 ss maizenamel.
INSERT INTO recipes VALUES (UNHEX(REPLACE('d34bb830-189b-4ea9-b094-381b1ca871f4', '-','')), 'Rask, enkel og veldig god pasta med nygrillet kylling og hjemmelaget fløtesaus. Hjemmelaget fløtesaus lages enkelt på føte, eggeplommer og sitronsaft, og har en god og rund smak. Middagen metter godt og passer for hele familien.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/cjegnfa0hteigone7dqe/kremet-pasta-med-grillet-kylling-og-hjemmelaget-flotesaus', 'Ferdig og nygrillet kylling får du i varmeskapet hos alle MENY-butikker hele dagen. Du kan også bruke kyllingfilet, og kylling kan byttes ut med røkelaks eller kokt skinke.
INSERT INTO recipes VALUES (UNHEX(REPLACE('59c6529c-4209-441d-b159-a432f8925d11', '-','')), 'Enkelt og sommerlig middagstips med laks, potetsalat og rød pesto. Tilbered gjerne på grillen. Rask fiskemiddag på under 20 minutter.', 40, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/zxvdjkeb08z7pjfweran/laks-med-pesto-og-potetsalat', 'Krydre laksefiletene med salt og pepper. Stek dem i rapsolje i en stekepanne til fisken er gyllen på begge sider og gjennomstekt. Dette tar ca 3 minutter på hver side. Dersom du skal grille fisken bør du pensle den med litt rapsolje, eventuelt pensle et ark aluminiumsfolie og ha laksen oppå det, på grillen. Tilberedning tar ca like lang tid på grill som i panne, og laksen er klar når den er akkurat gjennomstekt.
INSERT INTO recipes VALUES (UNHEX(REPLACE('cb97522c-cdd2-40c9-bfbe-98bdd5f5891d', '-','')), 'Lekker asiatisk salat med vegetarisk "pulled pork", glassnudler og ingefær, toppet med peanøtter og lime. Pulled vegetar er enkelt å lage og har blitt svært populært. Denne oppskriften er full av smak og et litt sunnere alternativ for deg som er vegetarianer, veganer, ønsker å kutte ned på kjøtt eller bare har lyst til å prøve noe nytt.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/pk5z25wdciexlqtsltde/asiatisk-salat-med-glassnudler-og-pulled-vegetar', 'Varm Pulled i en kasserolle med olje.
INSERT INTO recipes VALUES (UNHEX(REPLACE('554ff796-5807-4f6a-a57e-8f9ae74db7cb', '-','')), 'Taco egner seg godt som salat i en bolle, da blander du bare ingrediensene istedenfor å ha dem én og én i tortilla eller tacoskjell. Tacosalat er også et godt restetips. Topp gjerne med nachochips eller knust tacoskjell for crunch, og jalapeños for sterk smak.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/ogzalwfslobkenppdllz/spicy-tacosalat', 'Stek kjøttdeigen sammen med 2 ss tacokrydder i oljen til den er gyllen og gjennomstekt.
INSERT INTO recipes VALUES (UNHEX(REPLACE('18e9c239-250c-4957-bcc2-b21da4fd4be1', '-','')), 'Rask og enkel oppskrift på hjemmelaget spinatsuppe med kyllingkraft og hvitløk. God middag for hele familien på en kald høstdag!', 40, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/mmgbrfend9dvaz4vkkbx/hjemmelaget-spinatsuppe', 'Fres løk og hvitløk i smør i en kasserolle. Rør inn bladene når løken har blitt blank og mør. Fres videre
INSERT INTO recipes VALUES (UNHEX(REPLACE('98b836bd-48f5-4d5c-8d7d-7a67e9abaae4', '-','')), 'Glad i lapskaus? Prøv grønnsakslapskaus! Dette er en oppskrift på klassisk lapskaus med norske rotgrønnsaker og vegetarboller. Dersom du bruker melne poteter vil lapskausen normalt jevne seg selv, gjør den ikke det kan du jevne med maisenna.', 60, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/apqggprpnojzrwfhiylw/kjottfri-lapskaus', 'Kutt poteter og grønnsaker i grove terninger.
INSERT INTO recipes VALUES (UNHEX(REPLACE('a9135e88-4ce8-442d-955b-58040944794d', '-','')), 'En enkel vegetarmiddag full av smak. Ypperlig for deg som har lyst på en kjøttfri middag eller er vegetarianer. Den smaker ekstra godt sammen med en dressing laget av kesam, chili og frisk koriander.', 60, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/pjhv9k5sh5njmetsnuut/grove-og-smakfulle-vegetarwraps', 'Kok aspargesbønnene i lettsaltet vann i 1 minutt. Avkjøl i kaldt vann.
INSERT INTO recipes VALUES (UNHEX(REPLACE('3159014b-fa3b-4b4e-ba60-ce7a349c5392', '-','')), 'Enkel og rask viltgryte med reinskav gir smak av høst. Viltmiddag med reinsdyr, grønnsaker og einebær, i deilig saus av kraft, brunost og rømme. Hjemmelaget potetstappe er perfekt som tilbehør til viltgryte.', 20, 'https://res.cloudinary.com/norgesgruppen/images/c_scale,dpr_auto,f_auto,q_auto:eco,w_1600/zomit8tatmwlr8vigkot/viltgryte-med-reinsdyr', 'Begynn med å grovkutte gulrøtter, sopp og deretter finkutte løken.
